  /// <summary>Provides methods for executing a <a href='ReportJob'>ReportJob</a> and
  /// retrieving performance and statistics about ad campaigns, networks, inventory
  /// and sales. <p>Follow the steps outlined below:</p> <p> <ul> <li>Create the
  /// <code>ReportJob</code> object by invoking <a
  /// href='ReportService#runReportJob'>ReportService#runReportJob</a>.</li> <li>Poll
  /// the <code>ReportJob</code> object using <a
  /// href='ReportService#getReportJob'>ReportService#getReportJob</a>.</li>
  /// <li>Continue to poll the <code>ReportJob</code> object until the <a
  /// href='ReportJob#reportJobStatus'>ReportJob#reportJobStatus</a> field is equal to
  /// <a href='ReportJobStatus#COMPLETED'>ReportJobStatus#COMPLETED</a> or <a
  /// href='ReportJobStatus#FAILED'>ReportJobStatus#FAILED</a>.</li> <li>If
  /// successful, fetch the URL for downloading the report by invoking <a
  /// href='ReportService#getReportDownloadURL'>ReportService#getReportDownloadURL</a>.</li>
  /// </ul> <br /> <br /> <h4>Test network behavior</h4> </p><p>The networks created
  /// using <a
  /// href='NetworkService#makeTestNetwork'>NetworkService#makeTestNetwork</a> are
  /// unable to provide reports that would be comparable to the production environment
  /// because reports require traffic history. In the test networks, reports will
  /// consistently return no data for all reports.</p>
  /// </summary>
  public interface IReportService {
    RequestHeader RequestHeader {
      get;
      set;
    }

    ResponseHeader ResponseHeader {
      get;
      set;
    }

    /// <summary>Returns the URL at which the report file can be downloaded. <p>The report will
    /// be generated as a gzip archive, containing the report file itself. </p>
    /// </summary><param name='reportJobId'>the ID of the <a
    /// href='ReportJob'>ReportJob</a></param>
    /// <param name='exportFormat'>the <a href='ExportFormat'>ExportFormat</a> for the
    /// report file</param>
    /// <returns>the URL for report file download</returns>
    string getReportDownloadURL(long reportJobId, ExportFormat exportFormat);

    /// <summary>Returns the URL at which the report file can be downloaded, and allows for
    /// customization of the downloaded report. <p>By default, the report will be
    /// generated as a gzip archive, containing the report file itself. This can be
    /// changed by setting <a
    /// href='ReportDownloadOptions#useGzipCompression'>ReportDownloadOptions#useGzipCompression</a>
    /// to false. </p>
    /// </summary><param name='reportJobId'>the ID of the <a
    /// href='ReportJob'>ReportJob</a></param>
    /// <param name='reportDownloadOptions'>the <a
    /// href='ReportDownloadOptions'>ReportDownloadOptions</a> for the request</param>
    /// <returns>the URL for report file download</returns>
    string getReportDownloadUrlWithOptions(long reportJobId, ReportDownloadOptions reportDownloadOptions);

    /// <summary>Returns the <a href='ReportJobStatus'>ReportJobStatus</a> of the report job with
