  /// <summary>Provides methods for estimating traffic (clicks/impressions) for line items.
  /// Forecasts can be provided for <a href='LineItem'>LineItem</a> objects that exist
  /// in the system or which have not had an ID set yet. <h4>Test network
  /// behavior</h4> <p>Test networks are unable to provide forecasts that would be
  /// comparable to the production environment because forecasts require traffic
  /// history. For test networks, a consistent behavior can be expected for forecast
  /// requests, according to the following rules:</p> <table> <tr> <th
  /// colspan="2">Inputs<br /> (<a href='LineItem'>LineItem</a> Fields)</th> <th
  /// colspan="4">Outputs<br /> (<a href='Forecast'>Forecast</a> Fields)</th> </tr>
  /// <tr> <th><a href='LineItem#lineItemType'>lineItemType</a></th> <th><a
  /// href='LineItem#unitsBought'>unitsBought</a></th> <th><a
  /// href='Forecast#availableUnits'>availableUnits</a></th> <th><a
  /// href='Forecast#forecastUnits'>forecastUnits (matchedUnits)</a></th> <th><a
  /// href='Forecast#deliveredUnits'>deliveredUnits</a></th> <th>Exception </th> </tr>
  /// <tr> <td>Sponsorship</td> <td>13</td> <td>#x2013;#x2013;</td>
  /// <td>#x2013;#x2013;</td> <td>#x2013;#x2013;</td> <td><a
  /// href='ForecastError.Reason#NO_FORECAST_YET'>NO_FORECAST_YET</a> </td> </tr> <tr>
  /// <td>Sponsorship</td> <td>20</td> <td>#x2013;#x2013;</td> <td>#x2013;#x2013;</td>
  /// <td>#x2013;#x2013;</td> <td><a
  /// href='ForecastError.Reason#SERVER_NOT_AVAILABLE'>SERVER_NOT_AVAILABLE</a> </td>
  /// </tr> <tr> <td>Sponsorship</td> <td>50</td> <td>1,200,000</td>
  /// <td>6,000,000</td> <td>600,000<br /> For prospective: 0</td>
  /// <td>#x2013;#x2013;</td> </tr> <tr> <td>Sponsorship</td> <td>!= 20 and<br /> !=
  /// 50</td> <td>1,200,000</td> <td>1,200,000</td> <td>600,000<br /> For prospective:
  /// 0</td> <td>#x2013;#x2013;</td> </tr> <tr> <td>Not Sponsorship</td> <td>&lt;=
  /// 500,000</td> <td>3 * unitsBought / 2</td> <td>unitsBought * 6</td>
  /// <td>600,000<br /> For prospective: 0</td> <td>#x2013;#x2013;</td> </tr> <tr>
  /// <td>Not Sponsorship</td> <td>&gt; 500,000 and &lt;= 1,000,000</td>
  /// <td>unitsBought / 2</td> <td>unitsBought * 6</td> <td>600,000<br /> For
  /// prospective: 0</td> <td>#x2013;#x2013;</td> </tr> <tr> <td>Not Sponsorship</td>
  /// <td>&gt; 1,000,000 and &lt;= 1,500,000</td> <td>unitsBought / 2</td> <td>3 *
  /// unitsBought / 2</td> <td>600,000<br /> For prospective: 0</td>
  /// <td>#x2013;#x2013;</td> </tr> <tr> <td>Not Sponsorship</td> <td>&gt;
  /// 1,500,000</td> <td>unitsBought / 4</td> <td>3 * unitsBought / 2</td>
  /// <td>600,000<br /> For prospective: 0</td> <td>#x2013;#x2013;</td> </tr> </table>
  /// </summary>
  public interface IForecastService {
    RequestHeader RequestHeader {
      get;
      set;
    }

    ResponseHeader ResponseHeader {
      get;
      set;
    }

    /// <summary>Gets the availability forecast for a <a
